import styles from "./NavBar.module.scss";

export const NavBar = () => {
  return (
    <div className={styles.nav}>
      <div className={styles.navbar}>
        <a className={styles.navbar_brand}>CjT</a>
        </div>
        <div className={styles.navbar}>
        <a className={styles.navbar_links}>PROJECTS</a>
        <a className={styles.navbar_links}>SKILLS</a>
        <a className={styles.navbar_links}>CV</a>
      </div>
    </div>
  );
};
